import React from 'react';
function LeftSection({
    imageURL,
    productName,
    productDescription,
    tryDemo,
    learnMore,
    googlePlay,
    appStore,
}) {
    return (
        <div className='container'>
            <div className='row'>
                <div className='col-6 p-3'>
                    <img src={imageURL}/>
                </div>
                <div className='col-6 p-3'>
                    <h1>{productName}</h1>
                    <p>{productDescription}</p>
                    <a href={tryDemo}></a>
                    <a href={learnMore}></a>
                    <a href={googlePlay}><img src='https://upload.wikimedia.org/wikipedia/commons/thumb/7/78/Google_Play_Store_badge_EN.svg/1200px-Google_Play_Store_badge_EN.svg.png' style={{width:"21%"}}/></a>
                    <a href={appStore}><img src='media\images\appstoreBadge.svg'/></a>
                </div>
            </div>
        </div>
    );
}

export default LeftSection;
